
function BitcoinAddressCheck(a){var b=bitcoincheck(a);if(b==false){return false}else{return true}}function bitcoincheck(a){var b=base58decode2(a);if(b.length!=25){return false}var c=b.substr(b.length-4);var e=b.substr(0,b.length-4);var d=hex2a(sha256_digest(hex2a(sha256_digest(e)))).substr(0,4);if(c!=d){return false}return true}function base58decode2(h){var o="123456789ABCDEFGHJKLMNPQRSTUVWXYZabcdefghijkmnopqrstuvwxyz";var a=new Array();var g;for(g=0;g<58;g++){a[o[g]]=int2bigInt(g,8,0)}var e=h.length;var f=int2bigInt(0,1,0);var n=int2bigInt(58,8,0);var m;for(g=0;g<e;g++){m=h[e-g-1];f=add(f,mult(a[m],pow(n,g)))}var d=bigInt2str(f,16);var k=hex2a(d);var j;for(j=0;h[j]==o[0];j++){}var b=k;if(j>0){b=repeat("\0",j)+k}return b}function hex2a(b){var c="";for(var a=0;a<b.length;a+=2){c+=String.fromCharCode(parseInt(b.substr(a,2),16))}return c}function a2hex(f){var c="0123456789abcdef";var a=f.length;var g;var e;var d="";for(var b=0;b<a;b++){g=f.charCodeAt(b);e=c[Math.floor(g/16)];e+=c[g%16];d+=e}return d}function pow(a,d){if(d==0){return int2bigInt(1,1,0)}var b;var c=a;for(b=1;b<d;b++){c=mult(c,a)}return c}function repeat(c,d){var b=[];while(b.length<d){b.push(c)}return b.join("")};